import React from 'react'
import Slider from 'react-slick'

const Testimonial = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3">
        <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Provident dolorum, culpa sed illo iure et qui nesciunt nisi laudantium delectus distinctio ipsum reiciendis? Illum maxime iusto provident optio ea a.</p>
      </div>
    </Slider>
  )
}

export default Testimonial
